import styled from 'styled-components'

const HeroComponent = styled.section`
  width: 100%;
  h2{
    color:#66708D;
    font-weight: 300;
    font-size: 20px;
    margin-bottom: 12px;
  }
  h1{
    color:#CCD6F6;
    font-weight: 400;
    font-size: 48px;
    margin-top: 0;
  }
`
export default HeroComponent
